import React, { useEffect, useState } from 'react';
import { useLocation } from 'react-router-dom';
import { Box, Typography, Accordion, AccordionSummary, AccordionDetails, Card, CardContent, List, ListItem, ListItemText } from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { APIProvider, Map, Marker } from '@vis.gl/react-google-maps';
import axios from 'axios';

const ItineraryPage: React.FC = () => {
  // Helper to get coordinates from place details (dummy fallback if not available)
  const getCoords = (place: any) => {
    if (place && place.geometry && place.geometry.location) {
      return {
        lat: place.geometry.location.lat,
        lng: place.geometry.location.lng,
      };
    }
    return { lat: 13.7563, lng: 100.5018 };
  };

  // State for Google Maps API key
  const [mapsApiKey, setMapsApiKey] = useState<string>('');

  useEffect(() => {
    axios.get('http://localhost:8000/config/maps-key')
      .then(res => setMapsApiKey(res.data.mapsApiKey));
  }, []);

  const location = useLocation();
  const itineraryData = location.state?.itinerary?.itinerary;

  if (!itineraryData) {
    return <Typography variant="h6" color="error">No itinerary data found.</Typography>;
  }

  // Collect all places for markers
  const allPlaces: any[] = [];
  itineraryData.days?.forEach((day: any) => {
    day.activities?.forEach((activity: any) => {
      activity.places?.forEach((place: any) => {
        allPlaces.push(place);
      });
    });
    day.food_recommendations?.forEach((food: any) => {
      food.places?.forEach((place: any) => {
        allPlaces.push(place);
      });
    });
  });

  // Center map on first place or fallback
  const center = allPlaces.length > 0 ? getCoords(allPlaces[0]) : { lat: 13.7563, lng: 100.5018 };

  return (
    <Box sx={{ maxWidth: 800, mx: 'auto', mt: 4, mb: 4 }}>
      <Typography variant="h4" fontWeight="bold" gutterBottom>
        Trip Itinerary
      </Typography>
      {/* Trip summary (customize as needed) */}
      <Card sx={{ mb: 4 }}>
        <CardContent>
          <Typography variant="h5" fontWeight="bold" gutterBottom>Trip Summary</Typography>
          {(() => {
            let summary = location.state?.itinerary?.itinerary;
            let parsed;
            try {
              parsed = typeof summary === 'string' ? JSON.parse(summary) : summary;
            } catch (e) {
              parsed = null;
            }
            if (parsed && parsed.days) {
              return (
                <Box>
                  {parsed.days.map((day: any, idx: number) => (
                    <Box key={idx} sx={{ mb: 4 }}>
                      <Typography variant="h6" color="primary" fontWeight="bold" sx={{ mb: 1 }}>Day {day.day}:</Typography>
                      <ul style={{ marginLeft: 24 }}>
                        {day.activities?.map((activity: any, i: number) => (
                          <li key={i} style={{ fontSize: '1rem', marginBottom: 4 }}>{activity}</li>
                        ))}
                        {day.food_recommendations?.map((food: any, i: number) => (
                          <li key={i} style={{ fontSize: '1rem', marginBottom: 4, color: '#1976d2' }}>{food}</li>
                        ))}
                      </ul>
                    </Box>
                  ))}
                </Box>
              );
            }
            // fallback: try to parse manually if summary is a stringified JSON
            if (typeof summary === 'string') {
              try {
                const manual = JSON.parse(summary);
                if (manual && manual.days) {
                  return (
                    <Box>
                      {manual.days.map((day: any, idx: number) => (
                        <Box key={idx} sx={{ mb: 4 }}>
                          <Typography variant="h6" color="primary" fontWeight="bold" sx={{ mb: 1 }}>Day {day.day}:</Typography>
                          <ul style={{ marginLeft: 24 }}>
                            {day.activities?.map((activity: any, i: number) => (
                              <li key={i} style={{ fontSize: '1rem', marginBottom: 4 }}>{activity}</li>
                            ))}
                            {day.food_recommendations?.map((food: any, i: number) => (
                              <li key={i} style={{ fontSize: '1rem', marginBottom: 4, color: '#1976d2' }}>{food}</li>
                            ))}
                          </ul>
                        </Box>
                      ))}
                    </Box>
                  );
                }
              } catch (e) {}
            }
            // fallback: show as plain text
            return (
              <Typography variant="body1" sx={{ whiteSpace: 'pre-line', fontFamily: 'monospace', background: '#f5f5f5', p: 2, borderRadius: 2 }}>
                {summary || 'No summary available.'}
              </Typography>
            );
          })()}
        </CardContent>
      </Card>
      {/* Daily plans */}
      {itineraryData.days?.map((day: any, idx: number) => (
        <Accordion key={idx} sx={{ mb: 2 }}>
          <AccordionSummary expandIcon={<ExpandMoreIcon />}>
            <Typography variant="h6">Day {day.day}</Typography>
          </AccordionSummary>
          <AccordionDetails>
            <Typography variant="subtitle1" fontWeight="bold">Activities</Typography>
            <List>
              {day.activities?.map((activity: any, i: number) => (
                <ListItem key={i} alignItems="flex-start">
                  <ListItemText
                    primary={activity.description}
                    secondary={activity.places?.map((place: any) => (
                      <span key={place.name}>
                        <strong>{place.name}</strong>: Rating {place.rating || 'N/A'}<br />
                        {place.review_summary && <span>{place.review_summary}<br /></span>}
                        {place.address && <span>{place.address}<br /></span>}
                      </span>
                    ))}
                  />
                </ListItem>
              ))}
            </List>
            <Typography variant="subtitle1" fontWeight="bold" sx={{ mt: 2 }}>Food Recommendations</Typography>
            <List>
              {day.food_recommendations?.map((food: any, i: number) => (
                <ListItem key={i} alignItems="flex-start">
                  <ListItemText
                    primary={food.description}
                    secondary={food.places?.map((place: any) => (
                      <span key={place.name}>
                        <strong>{place.name}</strong>: Rating {place.rating || 'N/A'}<br />
                        {place.review_summary && <span>{place.review_summary}<br /></span>}
                        {place.address && <span>{place.address}<br /></span>}
                      </span>
                    ))}
                  />
                </ListItem>
              ))}
            </List>
          </AccordionDetails>
        </Accordion>
      ))}
      {/* Google Map with markers */}
      <Box sx={{ mt: 6, height: 400 }}>
        {mapsApiKey && (
          <APIProvider apiKey={mapsApiKey}>
            <Map center={center} zoom={12} style={{ width: '100%', height: '100%' }}>
              {allPlaces.map((place, idx) => {
                const coords = getCoords(place);
                return <Marker key={idx} position={coords} title={place.name} />;
              })}
            </Map>
          </APIProvider>
        )}
      </Box>
    </Box>
  );
};

export default ItineraryPage;
